import Typography from '@material-ui/core/Typography'
import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Avatar from '@material-ui/core/Avatar';
import Box from '@material-ui/core/Box';
import Button from '@material-ui/core/Button';
import Divider from '@material-ui/core/Divider';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import img1 from './googlepic.png';

const useStyles = makeStyles({
    TypographyStyle:{
        // fontweight: 800
    }

})

export default function Thirdrow() {
  const classes = useStyles();
    return(<>
    
        <Typography id="Typographyid">
            Linked accounts
        </Typography>
             <Typography id="Typographyid2">
             We use this to let you sign in and populate your profile information
             </Typography>
             
             <Grid id="idofhrform3" container spacing={1}>
                
                <Grid item xs={6} sm={3}>
                    <img src="img1" alt="" />
                <Avatar id="googleId" src="googlepic.png" />
                </Grid>
                <Grid item xs={6} sm={3}>
                <Typography id="Typographyid3">
                Sign in with Google
                </Typography>
                </Grid>
                <Grid   container justify="flex-end" item xs={6} sm={6}>
                <Button id="Conntbtn" variant="outlined" >
                Connect
                </Button>
                </Grid>
            </Grid>
      
        </>
    );
}
